    /**
     * 读取输入流到一个ByteArrayInputStream
     * @param inputStream 要读取的输入流
     * @return ByteArrayInputStream
     * @throws IOException
     */
    public static ByteArrayInputStream readInputStream(InputStream inputStream) throws IOException {
        byte[] buffer = new byte['Ѐ'];
        int len;
        ByteArrayOutputStream bos = new ByteArrayOutputStream();
        while ((len = inputStream.read(buffer)) != -1) {
            bos.write(buffer, 0, len);
        }
        bos.close();
        return new ByteArrayInputStream(bos.toByteArray());
    }

    /**
     * 把一个字符串数组合并成一个字符串并用空格隔开每个数据
     * @param input 要合并的数组
     * @return 用字符串分开的已经合并的数组
     */
    public static String mergeStringWithSpace(String... input){
        StringBuilder builder = new StringBuilder();
        for (String s : input){
            builder.append(s).append(" ");
        }
        return builder.toString();
    }

    /**
     * 将输入流读取为字节数组
     * @param inputStream 要读取的输入流
     * @return 字节数组
     * @throws IOException
     */
    public static byte[] readInputStreamToByte(InputStream inputStream) throws IOException {
        byte[] buffer = new byte['Ѐ'];
        int len;
        ByteArrayOutputStream bos = new ByteArrayOutputStream();
        while ((len = inputStream.read(buffer)) != -1) {
            bos.write(buffer, 0, len);
        }
        bos.close();
        return bos.toByteArray();
    }

    /***
     * 通过群昵称在一个群里获取到指定成员
     * @param group 群实例
     * @param nickName 群昵称
     * @return
     */
    public static Member searchMember(Group group,String nickName){
        for (Member member : group.getMembers()){
            if (member.getNameCard().equals(nickName)){
                return member;
            }
        }
        return null;
    }

    /**
     * 下载Url中的内容并返回一个字节数组
     * @param url1 指定url
     * @return 已经下载的内容
     */
    public static byte[] getBytes(String url1){
        try{
            logger.info(String.format("Downloading:%s",url1));
            final URL url = new URL(url1);
            HttpURLConnection connection = (HttpURLConnection) url.openConnection();
            connection.setRequestProperty("User-Agent", getRandomUserAgent());
            connection.setReadTimeout(30000);
            connection.setConnectTimeout(3000);
            connection.connect();
            try{
                if (connection.getResponseCode() == 200){
                    return readInputStreamToByte(connection.getInputStream());
                }else{
                    logger.log(Level.SEVERE,String.format("Response code:%s Response:%s",connection.getResponseCode(),new String(readInputStreamToByte(connection.getInputStream()))));
                }
            }finally {
                connection.disconnect();
            }
        }catch (Exception e){
            e.printStackTrace();
        }
        return null;
    }

    private static final Random RANDOM = new Random();

    /**
     * 获取一个随机的User-Agent，用于爬虫
     * @return User-Agent
     */
    public static String getRandomUserAgent(){
        int rLength = RANDOM.nextInt(agents.length-1);
        return agents[rLength];
    }

